import React from 'react'
import styles from './Header.module.css';
import { CSSTransition } from 'react-transition-group';
// import PropTypes from 'prop-types'
import './Header.css';

console.log(styles);

const Header = () => (
        <CSSTransition 
            in={true}
            appear={true}
            timeout={500}
            classNames={styles}>
            <header>
                <h1>Phonebook</h1>
            </header>
        </CSSTransition>
    )

export default Header
// className={styles.maintitle}
